●同乗者を走行中も退屈させない！<br>
走行中でもTV映像/ビデオ映像が楽しめる<br>
●簡単にノーマル制御復帰！<br>
切り替えスイッチでON/OFF可能、最適な制御を実現<br>
<br>
<img src="http://image.rakuten.co.jp/ainekusu/cabinet/02339514/imgrc0070054995.jpg"><br>
テレビキットのスイッチを「ON」にすると、以下の症状が発生します。<br>
■ナビの自車位置が停止します<br>
テレビキットをONにした状態では、GPSを受診しても補正されず、自車位置は停止したままとなります。<br>
テレビキットのスイッチをOFFにすると自車位置が復帰しますが、テレビキットをONにしている時間や走行環境によって、自車位置復帰まで時間を要することがあります。<br>
■自車位置を基にしたサービスが不正確になります<br>
テレビキットをONにした状態では自車位置が停止するため、ルート案内など自車位置をもとにして提供される情報が不正確になります。<br>
■エネルギーモニターのタイヤ回転表示が停止します。<br>
電気の流れなどを表示するエネルギーフロー表示、及び燃費情報には影響がありません。<br>
■メンテナンス情報が不正確になります。<br>
メンテナンス情報は車速信号を基準にした走行距離の積算から算出されるため、テレビキットをONにして走行した分が積算されず、算出される情報が不正確になります。<br>
※その他ご注意点<br>
・スペアスイッチホールがないため、ビルトインスイッチの装着は不可となります。<br>
・切り替えスイッチを使用しないオート制御テレビキットの設定はございません。<br>
・スマホ専用アプリ「Pocket PHV」の動作については未確認となります。<style type="text/css">
